window.bookSummaryJSON = "<p>A world gone mad. Creatures of nightmare walk the streets, but worse are those we once knew . . . </p> <p>Matt survived the Dungeon's founding, and managed to gather a small, but dedicated team to him, but when he finds his is not the only Dungeon in the area, he has a choice to make.</p> <p>Attempt friendly co-existence, but lose the element of surprise, or attack, and risk it all?</p> <p>Matt has learned the consequences of being too trusting when the world collapses around you, but is the path of grim dictator any better?</p> <p>Can he trust those around him? When those he left behind seem to be abusing his gift?</p>"; 
